import React from "react";

const Navbar = () => {
  return (
    <nav style={styles.nav}>
      <h2 style={styles.logo}>Mi Tienda</h2>
      <ul style={styles.menu}>
        <li>Inicio</li>
        <li>Productos</li>
        <li>Carrito</li>
      </ul>
    </nav>
  );
};

const styles = {
  nav: {
    background: "#1a1a1a",
    color: "white",
    padding: "20px 40px",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    borderBottom: "1px solid #e0e0e0",
    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.08)",
  },
  logo: { 
    margin: 0,
    fontSize: "24px",
    fontWeight: "700",
    letterSpacing: "1px",
    textTransform: "uppercase"
  },
  menu: {
    display: "flex",
    listStyle: "none",
    gap: "30px",
    margin: 0,
    padding: 0,
  },
};

export default Navbar;
